glsl3.vert:
precision highp float;
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
uniform CCLocal {
  mat4 cc_matWorld;
  mat4 cc_matWorldIT;
};
in vec3 a_position;
in vec4 a_color;
out vec4 v_color;
#if USE_TEXTURE
in vec2 a_uv0;
out vec2 v_uv0;
#endif
void main () {
  vec4 pos = vec4(a_position, 1);
  #if CC_USE_MODEL
  pos = cc_matViewProj * cc_matWorld * pos;
  #else
  pos = cc_matViewProj * pos;
  #endif
  #if USE_TEXTURE
  v_uv0 = a_uv0;
  #endif
  v_color = a_color;
  gl_Position = pos;
}

glsl3.frag:
precision highp float;
#if USE_ALPHA_TEST
  uniform ALPHA_TEST {
    float alphaThreshold;
  };
#endif
void ALPHA_TEST (in vec4 color) {
  #if USE_ALPHA_TEST
      if (color.a < alphaThreshold) discard;
  #endif
}
void ALPHA_TEST (in float alpha) {
  #if USE_ALPHA_TEST
      if (alpha < alphaThreshold) discard;
  #endif
}
uniform CCGlobal {
  mat4 cc_matView;
  mat4 cc_matViewInv;
  mat4 cc_matProj;
  mat4 cc_matProjInv;
  mat4 cc_matViewProj;
  mat4 cc_matViewProjInv;
  vec4 cc_cameraPos;
  vec4 cc_time;
  mediump vec4 cc_screenSize;
  mediump vec4 cc_screenScale;
};
in vec4 v_color;
#if USE_TEXTURE
in vec2 v_uv0;
uniform sampler2D texture;
#endif
uniform InputData{
  float outlineWidth;
};
bool checkIsMakeOutline(vec2 pos){
  float alpha = 0.1;
  vec4 color = texture(texture, pos);
  if(color.a <= alpha || outlineWidth == 0.0)return false;
  color = texture2D(texture, pos + vec2(0, outlineWidth));
  if(color.a <= alpha)return true;
  color = texture2D(texture, pos + vec2(outlineWidth, outlineWidth));
  if(color.a <= alpha)return true;
  color = texture2D(texture, pos + vec2(outlineWidth, 0));
  if(color.a <= alpha)return true;
  color = texture2D(texture, pos + vec2(outlineWidth, -outlineWidth));
  if(color.a <= alpha)return true;
  color = texture2D(texture, pos + vec2(0, -outlineWidth));
  if(color.a <= alpha)return true;
  color = texture2D(texture, pos + vec2(-outlineWidth, -outlineWidth));
  if(pos.x <= outlineWidth || pos.x >= 1.0 - outlineWidth)return true;
  if(pos.y <= outlineWidth || pos.y >= 1.0 - outlineWidth)return true;
  return false;
}
void main () {
  vec4 o = vec4(0,0,0,0);
  #if USE_TEXTURE
  o *= texture(texture, v_uv0);
    #if CC_USE_ALPHA_ATLAS_TEXTURE
    o.a *= texture2D(texture, v_uv0 + vec2(0, 1)).r;
    #endif
  #endif
  o *= v_color;
  ALPHA_TEST(o);
  if(checkIsMakeOutline(v_uv0)){
    o = vec4(1, 1, 1, 1);
  }
  gl_FragColor = o;
}

